import React, { useEffect } from 'react';

const Accordion = () => {
    const lists = [];

    const fetchTodos = () => fetch('https://jsonplaceholder.typicode.com/todos').then(response => response.json());

    useEffect(async () => {
        const todos = await fetchTodos();
    });

    return (
        <ul>
            {lists.map((list, idx) => <li key={idx}>{list}</li>)}
        </ul>
    )
}

export { Accordion }
